import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms';

@Component({
  selector: 'app-new-produit',
  templateUrl: './new-produit.component.html',
  styleUrls: ['./new-produit.component.scss']
})
export class NewProduitComponent implements OnInit{

  produitForm!: FormGroup;

  constructor(private formbuilder: FormBuilder){}

  ngOnInit(): void {
    this.produitForm = this.formbuilder.group({
       ref_produit: [null],
       short_libel: [null],
       long_libel: [null],
       prix_ht: [null],
       slug: [null],
    })
  }

  onSubmitForm():void {
    console.log(this.produitForm.value)
  }

}
<div class="container-fluid col col-9 mx-auto text-center">
    <h2 class="text-uppercase text-white">Rajouter un nouveau produit</h2>
    <form [formGroup]="produitForm">
        <div class="mb-3">
            <label for="exampleInputEmail1" class="form-label">Email address</label>
            <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp">
            <div id="emailHelp" class="form-text">We'll never share your email with anyone else.</div>
          </div>
          <div class="mb-3">
            <label for="exampleInputPassword1" class="form-label">Password</label>
            <input type="password" class="form-control" id="exampleInputPassword1">
          </div>
          <div class="mb-3 form-check">
            <input type="checkbox" class="form-check-input" id="exampleCheck1">
            <label class="form-check-label" for="exampleCheck1">Check me out</label>
          </div>
          <button type="submit" class="btn btn-primary">Submit</button>
    </form>
</div>
